export default function CoinCourse() {
  const [answer, setAnwser] = useState();

  const getAnswer = async () => {
    const res = await fetch("https://jsonplaceholder.typicode.com/todos?_limit=1");
    const answer = await res.json();
    setAnwser(answer);
  };

  useEffect(() => {
    getAnswer();
  }, []);
    return {props: {answer},}

//   return (<div>{JSON.stringify(answer)}</div>);
}
